import React, { useState, useContext } from 'react';
import axios from 'axios';
import { AuthContext } from '../context/AuthContext';
import "../pages/Home.css";
import { useNavigate } from 'react-router-dom';

const Buscador = () => {
  const [query, setQuery] = useState('');
  const [error, setError] = useState('');
  const [loadingCosas, setLoadingCosas] = useState(false);
  const [cosas, setCosas] = useState([]);
  const [busquedasRecientes, setBusquedasRecientes] = useState([]);
  const navigate = useNavigate();

  const extraerDatosDeUsuario = () => {
    const datosRecuperar = JSON.parse(localStorage.getItem("datosUsuario"));
    if (datosRecuperar && datosRecuperar.token) {
      return [datosRecuperar.token, datosRecuperar.userId];
    } else {
      navigate("/");
    }
  };

  const { isLoggedIn } = useContext(AuthContext);

  const handleChange = (event) => {
    const trimmedQuery = event.target.value.trim();
    setQuery(trimmedQuery);
    search(trimmedQuery);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    const trimmedQuery = query.trim();
    if (trimmedQuery) {
      setQuery(trimmedQuery);
      search(trimmedQuery);
      addRecentSearch(trimmedQuery);
    }
  };
  
  
  
  const handleRecentSearch = (event, query) => {
    setQuery(query);
    search(query);
    addRecentSearch(query);
  };
  
  
  

  const search = async (searchQuery) => {
    if (searchQuery === '') {
      setError('Por favor, introduce un término de búsqueda');
      setCosas([]);
    } else {
      setError('');

      const [token, userId] = extraerDatosDeUsuario();
      try {
        const response = await axios.get(
          process.env.REACT_APP_API_URL + "/api/cosas/buscar/" + searchQuery,
          {
            headers: {
              Authorization: `Bearer ${token}`,
            },
          }
        );
        setCosas(response.data);
        setLoadingCosas(false);
      } catch (error) {
        console.log(error);
        setLoadingCosas(false);
        setError('Hubo un problema con la búsqueda');
      }
    }
  };

  const addRecentSearch = (searchQuery) => {
    setBusquedasRecientes(prevBusquedas => [searchQuery, ...prevBusquedas.slice(0, 6)]);
  };
  

  return (
    <div className='contenedorBuscador'>
      <div className='buscador'>
      <form class="form">
    <label for="search">
        <input required="" autocomplete="off" placeholder="search your chats" id="search" type="text"/>
        <div class="icon">
            <svg stroke-width="2" stroke="currentColor" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg" class="swap-on">
                <path d="M21 21l-6-6m2-5a7 7 0 11-14 0 7 7 0 0114 0z" stroke-linejoin="round" stroke-linecap="round"></path>
            </svg>
            <svg stroke-width="2" stroke="currentColor" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg" class="swap-off">
                <path d="M10 19l-7-7m0 0l7-7m-7 7h18" stroke-linejoin="round" stroke-linecap="round"></path>
            </svg>
        </div>
        <button type="reset" class="close-btn">
            <svg viewBox="0 0 20 20" class="h-5 w-5" xmlns="http://www.w3.org/2000/svg">
                <path clip-rule="evenodd" d="M4.293 4.293a1 1 0 011.414 0L10 8.586l4.293-4.293a1 1 0 111.414 1.414L11.414 10l4.293 4.293a1 1 0 01-1.414 1.414L10 11.414l-4.293 4.293a1 1 0 01-1.414-1.414L8.586 10 4.293 5.707a1 1 0 010-1.414z" fill-rule="evenodd"></path>
            </svg>
        </button>
    </label>
</form>
      </div>
  
      {busquedasRecientes.length > 0 && (
        <div className="recientes">
          <h3>Búsquedas recientes:</h3>
          <ul>
            {busquedasRecientes.map((busqueda, index) => (
              <li key={index}>
                <button onClick={(event) => handleRecentSearch(event, busqueda)}>
                  {busqueda}
                </button>
              </li>
            ))}
          </ul>
        </div>
      )}
  
      {cosas.length > 0 ? (
        cosas.map((result) => (
          <div className='resultados' key={result.id}>
            <h1>{result.nombre}</h1>
            <h2>están en {result.nombreCasa}</h2>
            <h2>en el {result.nombreHabitacion}</h2>
            <h2>dentro de {result.nombreArmario}</h2>
            <h2>en el cajón {result.nombreCajon}</h2>
          </div>
        ))
      ) : (
        <div className="error-message">{error}</div>
      )}
    </div>
  );
  
};

export default Buscador;
